from typing import List

class Node:
    def __init__(self, val: int):
        self.val = val
        self.left = None
        self.right = None

class Solution:
    def __init__(self):
        self.root = None

    def insert(self, val: int) -> None:
        if self.root is None:
            self.root = Node(val)
        else:
            self._insert(self.root, val)

    def _insert(self, node: Node, val: int) -> None:
        if val < node.val:
            if not node.left:
                node.left = Node(val)
            else:
                self._insert(node.left, val)
        else:
            if not node.right:
                node.right = Node(val)
            else:
                self._insert(node.right, val)

    def is_valid_tree(self, node: Node) -> bool:
        def gcd(a: int, b: int) -> int:
            while b:
                a, b = b, a % b
            return a

        a = 1
        b = node.val
        while a < b:
            a, b = b, gcd(a, b)
        return a == 1

    def reconstruct_tree(self, node: Node) -> None:
        if not node:
            return
        self.reconstruct_tree(node.left)
        self.reconstruct_tree(node.right)
        if self.is_valid_tree(node):
            self.insert(node.val)

    def reconstruct_binary_tree(self, a: List[int]) -> Node:
        self.root = None
        for val in a:
            self.insert(val)
        return self.root

